import React from 'react';
import Button from '@material-ui/core/Button';
import AddIcon from '@material-ui/icons/Add';

const Todo = () => {
    return(
        <>
        <div>
            <div>
                <br/>
                <h1> TODO List</h1>
                <br/>
                <input type="text" placeholder="add items"/>
                <Button><AddIcon/></Button>

                <ol>
                    <li>Buy And Apple</li>
                </ol>
            </div>
        </div>
        </>
    );
};

export default Todo
